    }
    onShow(payload){
        console.log(payload)
    }
    
    render(){
        return(
            <div className="textbox">
            <h1>
                Welcome, Puttipong
                <LoginPage handleSubmit={this.onShow}/>
            </h1>
            </div>
            
        )
    }
}
